import React, { useState } from 'react'

const App2 = () =>{

  const [text , uptext] = useState('');
  
const inputEvent = (event) =>{
  let newT = event.target.value;
  uptext(newT);
}

  return (
    <>
    <div>
      <h1> Hello {text} </h1>
      <input type="text"  placeholder='enter your name'  onChange={inputEvent}/>
      <button> Click Me </button>
    </div>
    </>
  );
}

export default App2;
